import React from "react";
import Router from "./router";
import './test/test';

interface IPeople {
  name: string;
  age: number;
}

type PersonType = 'doctor' | 'teacher';

function App() {
  const people: Record<PersonType, IPeople> = {
    doctor: {
      name: '张三',
      age: 20
    },
    teacher: {
      name: '李四',
      age: 18
    }
  }
  return (
    <div className="App">
      <Router></Router>
    </div>
  );
}

export default App;
